import teamPic from '../pics/teamPic.png';
import beet from '../pics/beet.png';
import mosquito from '../pics/mosq.jpg';

const Team = () => {
	const displayMosquitos = () => {
		const list = [];
        const angles = [];
        for (let i = 1; i <= 7; i++) {
            angles.push(360/7*i)
        }
		for (let i = 1; i <= 7; i++) {

			list.push(
				<img
					key={i}
					className={`w-1/5 rotate-[${angles[i-1]}deg]`}
					src={mosquito}
					alt='Mosquito'
				/>
			);
		}

		return list;
	};

	return (
		<div>
			<h1 className='text-center text-6xl m-2'>Team Members</h1>
			<div className='mx-20'>
				<img className='w-full' src={teamPic} alt='Team' />
			</div>
			<div className='w-1/2 mx-auto my-60'>
				<img className='w-full h-full' src={beet} alt='Beetroot' />
			</div>
			{displayMosquitos()}
		</div>
	);
};

export default Team;
